package ex6

import "testing"

func TestCamelcase(t *testing.T) {
	tests := []struct {
		name  string
		input string
		want  int32
	}{
		{
			"normal 5 words",
			"saveChangesInTheEditor",
			5,
		},
		{
			"single word",
			"singleword",
			1,
		},
		{
			"two words",
			"abCd",
			2,
		},
		{
			"single word 2 letters",
			"ab",
			1,
		},
		{
			"single word 3 letters",
			"abc",
			1,
		},
		{
			"huge text",
			"",
			557,
		},
		{
			"huge text 2",
			"",
			9,
		},
	}
	for _, test := range tests {
		t.Run(test.name, func(t *testing.T) {
			got := camelcase(test.input)
			if got != test.want {
				t.Errorf("%v should have %v words, but it has %v words", test.input, test.want, got)
			}
		})
	}
}
